import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "../App.css";

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const navigate = useNavigate();

  const handleLogout = () => {
    navigate("/login");
  };

  return (
    <>
      {/* ðŸ”¹ Hamburger Button (always visible) */}
      <div className="hamburger-btn" onClick={() => setIsOpen(!isOpen)}>
        <span></span>
        <span></span>
        <span></span>
      </div>

      {/* ðŸ”¹ Sidebar Drawer */}
      <aside className={`sidebar ${isOpen ? "open" : ""}`}>
        <div className="sidebar-header">
          <h2>Zeplun Admin</h2>
          <button className="close-btn" onClick={() => setIsOpen(false)}>Ã—</button>
        </div>

        <nav className="sidebar-links">
          <Link to="/dashboard" onClick={() => setIsOpen(false)}>Dashboard</Link>
          <Link to="/pending-partners" onClick={() => setIsOpen(false)}>Pending Partners</Link>
          <Link to="/approved-partners" onClick={() => setIsOpen(false)}>Approved Partners</Link>
          <Link to="/slots" onClick={() => setIsOpen(false)}>Slot Manager</Link>
          <Link to="/rate-card" onClick={() => setIsOpen(false)}>Rate Card</Link>
          <Link to="/partner-earnings" onClick={() => setIsOpen(false)}>Partner Earnings</Link>
        </nav>

        <div className="sidebar-footer">
          <button className="logout-btn" onClick={handleLogout}>Logout</button>
        </div>
      </aside>

      {/* Overlay (click outside to close) */}
      {isOpen && <div className="overlay" onClick={() => setIsOpen(false)}></div>}
    </>
  );
};

export default Navbar;
